// apiService.js
// Purpose: Centralize API calls to the backend

export const getFastingPlans = async () => {
  try {
        const response = await fetch('http://localhost:5000/api/fasting/plans');
    if (!response.ok) {
      throw new Error("Failed to fetch fasting plans");
    }
    return await response.json();
  } catch (error) {
    console.error("Error fetching fasting plans:", error);
    return { message: "Error fetching data" };
  }
};
